import { FC } from 'react';
import { Form, Input } from 'antd';

export const Login: FC = () => {
  const onSubmit = (value) => {
    console.log(value)
  }
  return(
    <div className={'container'}>
      <Form
      name = "basic"
      labelCol={{
        span: 8,
      }}
      onFinish={onSubmit}
      >
        <Form.Item
          label = "Name"
          name = "name"
          rules={[
            {
              required: true,
              message: "Укажите логин",
            },
          ]}
        >
          <Input />

        </Form.Item>
      </Form>
    </div>
  )
}
